@multimeric Oops! I got the #Python syntax backwards for the concatenation. ü§™

vals = ", ".join([
    "{k} = {v!r}"
    for k, v in my_opts.items()
])

In #rstats the comma would never be more than an argument there. It's still pretty counterintuitive to make it the object doing the work!

@LeafyEricScott What I needed was dput‚Äîalong with capture.output, which I just learned about!

capture.output is a pretty great little #rstats utils function that captures printed output as values. I needed it because dput just prints to the console.

